import react from 'react'
import App from '../../App'

function onLoggedIn (props) {

if (props.isLoggedIn) return (<div className="menu-left--poster"></div>)
else return (<div>
    <a>Meni</a>
    <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
    </ul>
</div>)
}


const MenuLeft = (props) => {
    const loggedIn = props.isLoggedIn;

    return (
        <div>
            {onLoggedIn(loggedIn)}
        </div>
    )
}

export default MenuLeft
